import {BrowserRouter, Route, Routes} from 'react-router-dom'
import LearningStylePredictor from "./components/LearnStylePredictor";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" component={LearningStylePredictor}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
